import React from "react";
import { ReactDOM } from "react"
import "./index.css"

const element = 'Olá lucas'

function App() {
    return (
        <div>
            {element}
        </div>
    )
}

const rootElement = document.getElementById("root")
ReactDOM.render(<App />, rootElement)
